import React, { Suspense } from 'react';
import { Canvas } from '@react-three/fiber';
import { useGLTF, OrbitControls } from '@react-three/drei';

// Component to load the GLB model
function MyModel() {
  const { scene } = useGLTF('/models/yourModel.glb'); // Path to your .glb file

  return <primitive object={scene} />;
}

// Main App component
function App() {
  return (
    <div style={{ height: '100vh', width: '100%' }}>
      <Canvas>
        {/* Ambient and point lights for visibility */}
        <ambientLight intensity={0.5} />
        <pointLight position={[10, 10, 10]} />

        {/* Suspense to handle the loading state */}
        <Suspense fallback={<div>Loading...</div>}>
          <MyModel />
        </Suspense>

        {/* OrbitControls to allow rotation and zoom */}
        <OrbitControls />
      </Canvas>
    </div>
  );
}

export default App;
